@a11r I can't speak for the performance group, but as a C-core developer, I do find the bm_diff data useful.  However, I think you do need to understand how to interpret it, since different columns tell you different things.

My understanding is that in terms of actual, user-visible performance, the only relevant columns are the `cpu_time` and `real_time` columns.  The other columns measure the number of operations that can *potentially* impact performance, which is useful information even if the change doesn't affect the two columns that really matter.

For example, if I add an atomic operation that I don't expect to be executed very often and it turns out that it is actually executed a lot more than I expected, that's useful information for me, even if it doesn't actually impact user-visible performance in this individual PR.  Even if the result of adding the atomic operation is negligible by itself (perhaps below the thresholds that bm_diff will report), the result of several PRs that each add atomic operations might in aggregate result in a user-visible performance problem.  So it's still something to keep an eye on, even if it's not an immediate problem.
